import styled from 'styled-components';
import { Routes, Route } from 'react-router-dom';

const Content = styled.div`
	text-align: center;
`;

const Header = () => <div>Шапка страницы</div>;
const Footer = () => <div>Подвал страницы</div>;

export const Blog = () => {
	return (
		<>
			<Header />
			<Content>
				<h2>Заголовок страницы</h2>
				<Routes>
					<Route path="/" element="" />
				</Routes>
			</Content>
			<Footer />
		</>
	);
};
